bitquery.burn:
query ($token: String!) {
  initialSupply: ethereum(network: ethereum) {
    burn: transfers(
      currency: {is: $token}
      receiver: {is: "0x0000000000000000000000000000000000000000"}
    ) {
      amount(calculate: sum)
    }
  }
}

bitquery.fiscalLow:
query ($tokenAddress:String! , $date:[ISO8601DateTime!]) {
  ethereum(network: ethereum) {
    dexTrades(
      options: {asc: "priceInUsd", limit: 1}
      buyCurrency: {is: $tokenAddress}
      sellCurrency: {in: ["0xdac17f958d2ee523a2206206994597c13d831ec7", "0xa0b86991c6218b36c1d19d4a2e9eb0ce3606eb48"]}
      date: {in: $date}
    ) {
      block {
        height
      }
      timeInterval {
        day
      }
      transaction {
        hash
      }
      buyAmount
      buy_amount_usd: buyAmount(in: USD)
      priceInUsd: expression(get: "buy_amount_usd/buyAmount")
    }
  }
}
